import { readFileSync, existsSync } from 'fs';
import { extname } from 'path';

const PORT = 5000;

const mimeTypes = {
 '.html': 'text/html',
 '.css': 'text/css',
 '.js': 'application/javascript',
 '.png': 'image/png',
 '.svg': 'image/svg+xml',
 '.ico': 'image/x-icon'
};

const server = createServer((req, res) => {
 let filePath = req.url === '/' ? '/index.html' : req.url;
 filePath = filePath.startsWith('/') ? filePath.slice(1) : filePath;

 // Handle figmaAssets
 if (filePath.startsWith('figmaAssets/')) {
 filePath = filePath;
 }

 if (!existsSync(filePath)) {
 res.writeHead(404);
 res.end('File not found');
 return;
 }

 const ext = extname(filePath);
 const contentType = mimeTypes[ext] || 'text/plain';

 res.writeHead(200, { 
 'Content-Type': contentType,
 'Cache-Control': 'no-cache'
 });

 const content = readFileSync(filePath);
 res.end(content);
});

server.listen(PORT, '0.0.0.0', () => {
 console.log(` Breach Buster server running at http://0.0.0.0:${PORT}/`);
 console.log(' Your cyber security app is ready!');
});","size_bytes":1136},"server.py":{"content":"#!/usr/bin/env python3
import http.server
import socketserver
import os

PORT = 5000

class MyHTTPRequestHandler(http.server.SimpleHTTPRequestHandler):
 def end_headers(self):
 self.send_header('Cache-Control', 'no-cache, no-store, must-revalidate')
 self.send_header('Pragma', 'no-cache')
 self.send_header('Expires', '0')
 super().end_headers()

def main():
 os.chdir('.')
 with socketserver.TCPServer(("0.0.0.0", PORT), MyHTTPRequestHandler) as httpd:
 print(f"Server running at http://0.0.0.0:{PORT}/")
 print("Serving your Breach Buster application...")
 httpd.serve_forever()

if __name__ == "__main__":
 main()","size_bytes":678},"styles.css":{"content":"/* Reset and Base Styles */
* {
 margin: 0;
 padding: 0;
 box-sizing: border-box;
}

/* Enhanced Cyber Effects */
.glowing-cyber-title {
 animation: cyberGlow 3s ease-in-out infinite !important;
 text-shadow: 0 0 20px rgba(0, 255, 255, 0.8), 0 0 40px rgba(139, 69, 193, 0.6) !important;
}

.rotating-shield {
 animation: rotateShield 4s linear infinite !important;
 filter: drop-shadow(0 0 15px rgba(0, 255, 255, 0.8)) !important;
}

.rotating-shield-container {
 position: relative;
}

.rotating-shield-container::after {
 content: '';
 position: absolute;
 top: 50%;
 left: 50%;
 width: 80px;
 height: 80px;
 background: radial-gradient(circle, rgba(0, 255, 255, 0.2) 0%, transparent 70%);
 border-radius: 50%;
 transform: translate(-50%, -50%);
 animation: pulseCyber 2s ease-in-out infinite;
}

/* Enhanced Typing Effect */
.typing-text {
 position: relative;
}

.typing-text::after {
 content: '|';
 animation: blinkCursor 1s infinite, colorShift 2s ease-in-out infinite;
 margin-left: 2px;
}

/* Cyber Animations */
@keyframes cyberGlow {
 0%, 100% { 
 text-shadow: 0 0 20px rgba(0, 255, 255, 0.8), 0 0 40px rgba(139, 69, 193, 0.6);
 transform: scale(1);
 }
 50% { 
 text-shadow: 0 0 30px rgba(0, 255, 255, 1), 0 0 60px rgba(139, 69, 193, 0.9);
 transform: scale(1.02);
 }
}

@keyframes rotateShield {
 0% { transform: rotate(0deg); }
 100% { transform: rotate(360deg); }
}

@keyframes pulseCyber {
 0%, 100% { 
 opacity: 0.3;
 transform: translate(-50%, -50%) scale(1);
 }
 50% { 
 opacity: 0.7;
 transform: translate(-50%, -50%) scale(1.2);
 }
}

@keyframes blinkCursor {
 0%, 50% { opacity: 1; }
 51%, 100% { opacity: 0; }
}

@keyframes colorShift {
 0%, 100% { color: #00FFFF; }
 50% { color: #8B45C1; }
}

body {
 font-family: 'Ubuntu', sans-serif;
 background-color: #000;
 color: #fff;
 overflow-x: hidden;
 line-height: 1.6;
}

/* Background Animations */
.background-container {
